\n";

    init(argc, argv);

    /* --------------- pyramid parameters --------------- */
    int borderCols = (pyramid_height)*HALO;
    int smallBlockCol = BLOCK_SIZE-(pyramid_height)*HALO*2;
    int blockCols = cols/smallBlockCol+((cols%smallBlockCol==0)?0:1);

    printf("pyramidHeight: %d\ngridSize: [%d]\nborder:[%d]\nblockSize: %d\nblockGrid:[%d]\ntargetBlock:[%d]\n",\
	pyramid_height, cols, borderCols, BLOCK_SIZE, blockCols, smallBlockCol);
	
    int *gpuWall, *gpuResult[2];
    int size = rows*cols;

    cudaMalloc((void**)&gpuResult[0], sizeof(int)*cols);
    cudaMalloc((void**)&gpuResult[1], sizeof(int)*cols);
    cudaMemcpy(gpuResult[0], data, sizeof(int)*cols, cudaMemcpyHostToDevice);
    cudaMalloc((void**)&gpuWall, sizeof(int)*(size-cols));
    cudaMemcpy(gpuWall, data+cols, sizeof(int)*(size-cols), cudaMemcpyHostToDevice);

#ifdef  TIMING
    gettimeofday(&tv_kernel_start, NULL);
#endif

    int final_ret = calc_path(gpuWall, gpuResult, rows, cols, \
	 pyramid_height, blockCols, borderCols);

#ifdef  TIMING
    gettimeofday(&tv_kernel_end, NULL);
    tvsub(&tv_kernel_end, &tv_kernel_start, &tv);
    kernel_time += tv.tv_sec * 1000.0 + (float) tv.tv_usec / 1000.0;
#endif

    cudaMemcpy(result, gpuResult[final_ret], sizeof(int)*cols, cudaMemcpyDeviceToHost);

#ifdef BENCH_PRINT
    char *str_result = new char[(sizeof(char) * (strlen(results)+1))];
    str_result[0] = 0;
    for (int i = 0; i < cols; i++) {
      printf("%d ",data[i]);
      sprintf(str_result + strlen(str_result), "%d ", data[i]);
    }
    //printf("OLEEEE");
    printf("\n") ;
    sprintf(str_result + strlen(str_result), "\n");
    for (int i = 0; i < cols; i++) {
      printf("%d ",result[i]) ;
      sprintf(str_result + strlen(str_result), "%d ", result[i]);
    }
    printf("\n") ;
    sprintf(str_result + strlen(str_result), "\n");

    if (strcmp(results, str_result) == 0) {
      printf("Test PASSED\n");
    } else {
      printf("Test FAILED\n");
    }
#endif

    cudaFree(gpuWall);
    cudaFree(gpuResult[0]);
    cudaFree(gpuResult[1]);

    delete [] data;
    delete [] wall;
    delete [] result;
    delete str_result;

#ifdef  TIMING
    printf("Exec: %f\n", kernel_time);
#endif
}
